import React, { useEffect, useState } from "react";
import AddProduct from "../components/AddProduct";
import { Link } from "react-router-dom";
import axios from "axios";
import ReturnedProducts from "../components/ReturnedProducts";

const API_URL = "http://localhost:5005";

function Dashboard() {
  const [hideForm, setHideForm] = useState(true);
  const [hideAllProducts, setHideAllProducts] = useState(true);
  const [hideReturned, setHideReturned] = useState(true);
  const [allProducts, setAllProducts] = useState([]);
  const [allUsers, setAllUsers] = useState([]);
  const [hideUsers, setHideUsers] = useState(true);

  const storedToken = localStorage.getItem("authToken");

  const handleForm = () => {
    setHideForm(!hideForm);
  };

  const handleAllProducts = () => {
    setHideAllProducts(!hideAllProducts);
  };
  const handleAllUsers = () => {
    setHideUsers(!hideUsers);
  };

  const handleReturned = () => {
    setHideUsers(!hideUsers);
  };

  const getProducts = () => {
    axios
      .get(`${API_URL}/api/products`)
      .then((response) => {
        console.log(response.data);
        setAllProducts(response.data);
      })
      .catch((err) => console.log("Product List error: ", err));
  };

  const getUsers = () => {
    axios
      .get(`${API_URL}/api/users`, {
        headers: { Authorization: `Bearer ${storedToken}` },
      })
      .then((response) => {
        console.log(response.data);
        setAllUsers(response.data);
      })
      .catch((err) => console.log("User List error: ", err));
  };

  useEffect(() => {
    getProducts();
    getUsers();
  }, []);

  return (
    <div>
      <h1> Hey Admin!</h1>
      <h2>You made it to your dashboard</h2>
      <p>
        {" "}
        Add a new product: <button onClick={handleForm}>Show Form</button>
      </p>
      {!hideForm && <AddProduct />}
      <p>
        Returns to approve
        <button>Show Returned</button>
      </p>
      <ReturnedProducts allProducts={allProducts} />
      <p>
        View all Products{" "}
        <button onClick={handleAllProducts}>Show Products</button>
      </p>
      {!hideAllProducts && (
        <table className="productTable">
          <thead>
            <tr>
              <th>Name</th>
              <th>Category</th>
              <th>Stock</th>
              <th>Link</th>
            </tr>
          </thead>
          <tbody>
            {allProducts.map((product) => {
              return (
                <tr key={product._id}>
                  <th>{product.name}</th>
                  <th>{product.category}</th>
                  {product.inStock ? <th>In Stock</th> : <th>Rented</th>}
                  <th>
                    <Link to={`/admin/edit/product/${product._id}`}>Edit</Link>
                  </th>
                </tr>
              );
            })}
          </tbody>
        </table>
      )}

      <p>
        View all Users <button onClick={handleAllUsers}>Show Users</button>
      </p>
      {!hideUsers && (
        <table className="productTable">
          <thead>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>Membership</th>
              <th>Link</th>
            </tr>
          </thead>
          <tbody>
            {allUsers.map((user) => {
              return (
                <tr key={user._id}>
                  <th>{user.name}</th>
                  <th>{user.email}</th>
                  <th>{user.membership}</th>

                  <th>
                    <Link>Edit</Link>
                  </th>
                </tr>
              );
            })}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default Dashboard;
